import { Col, Container, Row } from 'react-bootstrap'

const NavBar = () => {
  return (
    // <div className='navbar'>
    <Container>
        <Row>
            <Col>

                    <h2 className='logo'>Mo<span className='special-v'>V</span>es</h2>

                    <input type='text' className='inp'/>


            </Col>
        </Row>
    </Container>
        

    // </div>
  )
}

export default NavBar
